/**
	How to generate gifts.js from Master doc.

	test	factor	range	type	narrative
	temperament	extravert	high	gift	I have a gift with people and am nourished...

	Steps
	
	1. Find master doc on shared G-Drive and copy it to a temporary spreadsheet.
	https://docs.google.com/spreadsheets/d/1lHaMSwCSTNogeztD4pPKawz0fHh8wVFu47nXq7FaUwY/edit#gid=0
	
	2. sort by type

	3. replace single quote with &rsquo;

	4. copy and paste into a tab-separated columns text file.  Make sure it's type UNIX.
	
	5. insert lines to separate groups by type: always, burnouts, defaults, gifts, nourishments
	
	6. run the following regexp find and replace
			(.*?)\t(.*?)\t(.*?)\t(.*?)\t(.*?)\n
			{ test:'$1', factor:'$2', range:'$3', narrative:'$5' },\n
	
	7. save into gifts.js
*/
